import * as React from "react";
import Avatar from "@mui/material/Avatar";
import Button from "@mui/material/Button";
import CssBaseline from "@mui/material/CssBaseline";
import TextField from "@mui/material/TextField";
import { Link } from "react-router-dom";
import Grid from "@mui/material/Grid";
import Box from "@mui/material/Box";
import LockOutlinedIcon from "@mui/icons-material/LockOutlined";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import { createTheme, ThemeProvider } from "@mui/material/styles";
import { useForm } from "react-hook-form";
import { useState } from "react";
import Snackbar from "../Components/Snackbar";
import { useNavigate } from "react-router-dom";
import { v4 as uuidv4 } from "uuid";
import { setUsersInStorage, getUsersInStorage } from "../Services/Storage";

function Copyright(props) {
  return (
    <Typography
      variant="body2"
      color="text.secondary"
      align="center"
      {...props}
    >
      {"Copyright Â© "}
      <Link color="inherit" to="https://ritiksinghrajput.netlify.app/">
        Ritik Singh
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}
let encodedPassword;

const defaultTheme = createTheme();

export default function SignUp() {
  const navigate = useNavigate();
  const [password, setPassword] = useState("");
  const [snackbarOpen, setSnackbarOpen] = useState(false); // State to control Snackbar visibility
  const {
    register,
    handleSubmit,
    formState: { errors, isSubmitting },
  } = useForm();

  function encrypt(data) {
    const baseString = data.password;
    encodedPassword = window.btoa(baseString);
    return encodedPassword;
  }

  const onSubmit = async (data) => {
    await new Promise((resolve) => setTimeout(resolve, 1000));
    const formData = Object.keys(data)
      .filter((objKey) => objKey !== "passwordConfirm")
      .reduce((newObj, key) => {
        newObj[key] = data[key];
        return newObj;
      }, {});

    formData.password = encrypt(data);
    const encryptedData = { ...formData };
    encryptedData.userId = uuidv4();
    const dataInStorage = getUsersInStorage();
    if (dataInStorage !== null) {
      const users = getUsersInStorage();
      users.push(encryptedData);
      setUsersInStorage(users);
      setSnackbarOpen(true); // Show Snackbar when data is added successfully
      setTimeout(() => {
        navigate("/", { state: { isDiverted: true } }); // Navigate after showing the Snackbar
      }, 2000); // Snackbar duration + transition time
    } else {
      const users = [encryptedData];
      setUsersInStorage(users);
      setSnackbarOpen(true); // Show Snackbar when data is added successfully
      setTimeout(() => {
        navigate("/", { state: { isDiverted: true } }); // Navigate after showing the Snackbar
      }, 2000); // Snackbar duration + transition time
    }
  };

  return (
    <>
      <div className="container">
        <ThemeProvider theme={defaultTheme}>
          <Container component="main" maxWidth="xs">
            <CssBaseline />
            <Box
              sx={{
                marginTop: 8,
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
              }}
            >
              <Avatar sx={{ m: 1, bgcolor: "secondary.main" }}>
                <LockOutlinedIcon />
              </Avatar>
              <Typography component="h1" variant="h5">
                Sign up
              </Typography>
              <Box
                component="form"
                noValidate
                onSubmit={handleSubmit(onSubmit)}
                sx={{ mt: 3 }}
              >
                <Grid container spacing={2}>
                  <Grid item xs={12}>
                    {/* Rest of the form inputs */}
                  </Grid>
                </Grid>
                <Button
                  type="submit"
                  fullWidth
                  variant="contained"
                  sx={{ mt: 3, mb: 2 }}
                  disabled={isSubmitting}
                >
                  {isSubmitting ? "Loading..." : "Sign Up"}
                </Button>
                <Grid container justifyContent="flex-end">
                  <Grid item>
                    <Link to="/" variant="body2">
                      Already have an account? Sign in
                    </Link>
                  </Grid>
                </Grid>
              </Box>
            </Box>
            <Snackbar
              open={snackbarOpen}
              onClose={() => setSnackbarOpen(false)}
              message="Data added successfully"
            />
            <Copyright sx={{ mt: 5 }} />
          </Container>
        </ThemeProvider>
      </div>
    </>
  );
}
